import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import TicketCard from '../components/TicketCard';
import ticketService from '../services/ticketService';
import userService from '../services/userService';
import '../styles/Dashboard.css';

const AdminDashboard = () => {
  const [stats, setStats] = useState({});
  const [tickets, setTickets] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const [statsResponse, ticketsResponse] = await Promise.all([
        userService.getDashboardStats(),
        ticketService.getTickets({ limit: 5 })
      ]);

      setStats(statsResponse);
      setTickets(ticketsResponse.tickets);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <>
        <Navbar />
        <div className="loading">Loading dashboard...</div>
      </>
    );
  }

  return (
    <>
      <Navbar />
      <div className="dashboard">
        <div className="dashboard-header">
          <h1>Admin Dashboard</h1>
        </div>

        <div className="stats-grid">
          <div className="stat-card">
            <h3>Total Tickets</h3>
            <div className="stat-number">{stats.totalTickets}</div>
          </div>
          <div className="stat-card">
            <h3>Open Tickets</h3>
            <div className="stat-number">{stats.openTickets}</div>
          </div>
          <div className="stat-card">
            <h3>In Progress</h3>
            <div className="stat-number">{stats.inProgressTickets}</div>
          </div>
          <div className="stat-card">
            <h3>Resolved</h3>
            <div className="stat-number">{stats.resolvedTickets}</div>
          </div>
        </div>

        <div className="charts-section">
          <div className="chart-card">
            <h3>Tickets by Type</h3>
            <div className="chart-content">
              {stats.ticketsByType?.map(item => (
                <div key={item._id} className="chart-item">
                  <span>{item._id}:</span>
                  <span>{item.count}</span>
                </div>
              ))}
            </div>
          </div>
          
          <div className="chart-card">
            <h3>Tickets by Urgency</h3>
            <div className="chart-content">
              {stats.ticketsByUrgency?.map(item => (
                <div key={item._id} className="chart-item">
                  <span>{item._id}:</span>
                  <span>{item.count}</span>
                </div>
              ))}
            </div>
          </div>
        </div>

        <div className="recent-tickets">
          <h2>Recent Tickets</h2>
          {tickets.length === 0 ? (
            <p>No tickets found.</p>
          ) : (
            <div className="tickets-grid">
              {tickets.map(ticket => (
                <TicketCard key={ticket._id} ticket={ticket} />
              ))}
            </div>
          )}
          <div className="view-all">
            <Link to="/tickets" className="btn-secondary">
              View All Tickets
            </Link>
          </div>
        </div>
      </div>
    </>
  );
};

export default AdminDashboard;
